import React from "react";




export default function Communitylist(setModalOpen) {
  
    let text = ""
    let input = ""
   
  

    return (
        <div>
         <label htmlFor="searchInput">Enter a Search Term </label>
            <input type="text" className="form-control" id="searchInput" onChange={(event) => {
            text = event.target
            }} />
            <button type="button" className="btn btn-success" onClick={(event) => {
                input = event.target
            }}>Search</button>
            
           

     
        </div>
    )
}
